import React from 'react';
import blogData from './blog.json';
const BlogOne = () => {
  return (
    <section id="blogMain">
      <div className="row">
        <div className="col-11 ms-5">
          <iframe src="./portfolio/blogweek1.html" className="preview-iframe"></iframe>
        </div>
      </div>
    </section>
  );
};

export default BlogOne;
